using AssemblyLib.Utils;using System;using System.Collections.Generic;using System.Collections.ObjectModel;using System.Linq;using System.Text;using System.Threading.Tasks;namespace AssemblyLib.AssemblyModels{	public class WindGirderInputModel : Notifier	{		public WindGirderInputModel()		{					Qty = "";			Elevation = "";			Distance = "";			Size = "";			CAForOneSide = "";		}				private string _Qty;		public string Qty			{				get { return _Qty; }				set				{					_Qty = value;					OnPropertyChanged(nameof(Qty));				}			}				private string _Elevation;		public string Elevation			{				get { return _Elevation; }				set				{					_Elevation = value;					OnPropertyChanged(nameof(Elevation));				}			}				private string _Distance;		public string Distance			{				get { return _Distance; }				set				{					_Distance = value;					OnPropertyChanged(nameof(Distance));				}			}				private string _Size;		public string Size			{				get { return _Size; }				set				{					_Size = value;					OnPropertyChanged(nameof(Size));				}			}				private string _CAForOneSide;		public string CAForOneSide			{				get { return _CAForOneSide; }				set				{					_CAForOneSide = value;					OnPropertyChanged(nameof(CAForOneSide));				}			}			}}